/* Input */
.input {
  width: 100%;
  padding-left: 1rem;
  padding-right: 1rem;
  padding-top: 0.75rem;
  padding-bottom: 0.75rem;
  background-color: #252526;
  border: 1px solid #3e3e42;
  border-radius: 0.5rem;
  color: white;
  transition-property: all;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
}

.input::placeholder {
  color: #969696;
}

.input:focus {
  outline: 2px solid transparent;
  outline-offset: 2px;
  ring: 2px solid #007acc;
  border-color: transparent;
}

/* Button Variants */
.btn-primary {
  background-color: #007acc;
  color: white;
  font-weight: 600;
  padding-top: 0.5rem;
  padding-bottom: 0.5rem;
  padding-left: 1rem;
  padding-right: 1rem;
  border-radius: 0.5rem;
  transition-property: color, background-color;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
}

.btn-primary:hover {
  background-color: #1a8dd8;
}

.btn-primary:disabled {
  background-color: #3e3e42;
  cursor: not-allowed;
}

.btn-secondary {
  background-color: #2d2d30;
  color: white;
  font-weight: 600;
  padding-top: 0.5rem;
  padding-bottom: 0.5rem;
  padding-left: 1rem;
  padding-right: 1rem;
  border-radius: 0.5rem;
  transition-property: color, background-color;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
}

.btn-secondary:hover {
  background-color: #3e3e42;
}

.btn-ghost {
  color: #cccccc;
  padding-top: 0.5rem;
  padding-bottom: 0.5rem;
  padding-left: 1rem;
  padding-right: 1rem;
  border-radius: 0.5rem;
  transition-property: color, background-color;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
}

.btn-ghost:hover {
  background-color: #252526;
  color: white;
}

/* Custom Components - converted to plain CSS for v4 compatibility */
.card {
  background-color: #252526;
  border-radius: 0.5rem;
  border: 1px solid #3e3e42;
  padding: 1rem;
}

.card-hover {
  background-color: #252526;
  border-radius: 0.5rem;
  border: 1px solid #3e3e42;
  padding: 1rem;
  transition-property: all;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
}

.card-hover:hover {
  border-color: #007acc;
  box-shadow: 0 10px 15px -3px rgb(0 122 204 / 0.2), 0 4px 6px -4px rgb(0 122 204 / 0.2);
}

/* Tool Call Status Colors */
.status-completed {
  color: #89d185;
}

.status-pending {
  color: #cca700;
}

.status-failed {
  color: #f48771;
}

/* Message Styles */
.message-user {
  background-color: #252526;
}

.message-assistant {
  background-color: #1e1e1e;
}

/* Code Block Styles */
.code-block {
  background-color: #1e1e1e;
  border-radius: 0.375rem;
  overflow: hidden;
  border: 1px solid #3e3e42;
}

.code-block-header {
  background-color: #252526;
  padding-left: 0.75rem;
  padding-right: 0.75rem;
  padding-top: 0.25rem;
  padding-bottom: 0.25rem;
  font-size: 0.75rem;
  line-height: 1rem;
  color: #969696;
  border-bottom: 1px solid #3e3e42;
}

a:hover {
  color: #1a8dd8;
}

